import React, { useState, useEffect } from 'react'

export const weather=() => {

    const searcher= async ()=>{
        let url='https://api.openweathermap.org/data/2.5/weather?zip=95014,us&appid=733cc9a44ea1fb2deea063b934b579fd&units=imperial';
        let response= await fetch(url);
        let data=response.json();
        const temp=document.getElementsByClassName("weather-temp");
        const windspeed= document.getElementsByClassName("wind-rate");
        const humidity= document.getElementsByClassName("humidity-percent");
        windspeed[0].innerHTML=data.wind.speed+"mph";
        temp[0].innerHTML=data.main.temp +"°F";
        humidity[0].innerHTML=data.main.humidity+"%";
    }
    return(
        <div>
            searcher()
            <p>Temperature: {temp}</p>
            <p>Humidity: {humidity}</p>
            <p>Wind Speed: {windspeed}</p>
        </div>
    )
}

export default weather
